let initialColor = "transparent";
const bodyClasses = document.body.classList;

for (const className of bodyClasses) {
  if (pageConfigs[className]) {
    initialColor = pageConfigs[className];
    break;
  }
}

// –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –∫–æ–º–ø–æ–Ω–µ–Ω—Ç–∞
new TransparentHeader(100, initialColor);

function createAlertBox(form) {
  let alertBox = document.createElement("div");
  alertBox.classList.add("form-alert");
  alertBox.innerText = `Subscription completed!`;
  form.appendChild(alertBox);
  setTimeout(() => {
    alertBox.remove();
  }, 3000);
}

/**
 * –î–∏–Ω–∞–º–∏—á–µ—Å–∫–æ–µ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–∏–µ –∏ –æ–±–Ω–æ–≤–ª–µ–Ω–∏–µ –≤—ã—Å–æ—Ç—ã header'–∞
 * –ê–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏ –æ–±–Ω–æ–≤–ª—è–µ—Ç CSS –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é --header-height
 */

class DynamicHeaderHeight {
  constructor() {
    this.header = document.querySelector(".header");
    this.debounceTimeout = null;

    if (!this.header) {
      console.warn("Header –Ω–µ –Ω–∞–π–¥–µ–Ω");
      return;
    }

    this.init();
  }

  init() {
    // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –Ω–∞—á–∞–ª—å–Ω—É—é –≤—ã—Å–æ—Ç—É
    this.updateHeaderHeight();

    // –û–±–Ω–æ–≤–ª—è–µ–º –ø—Ä–∏ –∏–∑–º–µ–Ω–µ–Ω–∏–∏ —Ä–∞–∑–º–µ—Ä–æ–≤ –æ–∫–Ω–∞
    window.addEventListener("resize", () => this.debounceUpdate());

    // –û–±–Ω–æ–≤–ª—è–µ–º –ø—Ä–∏ –ø–æ–≤–æ—Ä–æ—Ç–µ —É—Å—Ç—Ä–æ–π—Å—Ç–≤–∞
    window.addEventListener("orientationchange", () => {
      // –ù–µ–±–æ–ª—å—à–∞—è –∑–∞–¥–µ—Ä–∂–∫–∞ –¥–ª—è –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ–≥–æ –æ–ø—Ä–µ–¥–µ–ª–µ–Ω–∏—è –Ω–æ–≤—ã—Ö —Ä–∞–∑–º–µ—Ä–æ–≤
      setTimeout(() => this.updateHeaderHeight(), 100);
    });

    // –û–±–Ω–æ–≤–ª—è–µ–º –ø—Ä–∏ –∏–∑–º–µ–Ω–µ–Ω–∏–∏ DOM (–µ—Å–ª–∏ –¥–æ–±–∞–≤–ª—è–µ—Ç—Å—è/—É–±–∏—Ä–∞–µ—Ç—Å—è –∫–æ–Ω—Ç–µ–Ω—Ç –≤ header)
    if (window.MutationObserver) {
      const observer = new MutationObserver(() => this.debounceUpdate());
      observer.observe(this.header, {
        childList: true,
        subtree: true,
        attributes: true,
        attributeFilter: ["class", "style"],
      });
    }
  }

  updateHeaderHeight() {
    if (!this.header) return;

    // –ü–æ–ª—É—á–∞–µ–º —Ä–µ–∞–ª—å–Ω—É—é –≤—ã—Å–æ—Ç—É header'–∞
    const headerHeight = this.header.offsetHeight;

    // –û–±–Ω–æ–≤–ª—è–µ–º CSS –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é
    document.documentElement.style.setProperty(
      "--header-height",
      `${headerHeight}px`
    );

    // –¢–∞–∫–∂–µ —É—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –∫–∞–∫ data-–∞—Ç—Ä–∏–±—É—Ç –¥–ª—è –æ—Ç–ª–∞–¥–∫–∏
    document.documentElement.setAttribute("data-header-height", headerHeight);

    // –û–ø—Ü–∏–æ–Ω–∞–ª—å–Ω–æ: –ª–æ–≥–∏—Ä—É–µ–º –¥–ª—è –æ—Ç–ª–∞–¥–∫–∏
    // console.log(`Header height updated: ${headerHeight}px`);

    // –¢—Ä–∏–≥–≥–µ—Ä–∏–º –∫–∞—Å—Ç–æ–º–Ω–æ–µ —Å–æ–±—ã—Ç–∏–µ –¥–ª—è –¥—Ä—É–≥–∏—Ö —Å–∫—Ä–∏–ø—Ç–æ–≤
    window.dispatchEvent(
      new CustomEvent("headerHeightUpdated", {
        detail: { height: headerHeight },
      })
    );
  }

  debounceUpdate() {
    clearTimeout(this.debounceTimeout);
    this.debounceTimeout = setTimeout(() => {
      this.updateHeaderHeight();
    }, 150);
  }

  // –ü—É–±–ª–∏—á–Ω—ã–π –º–µ—Ç–æ–¥ –¥–ª—è –ø—Ä–∏–Ω—É–¥–∏—Ç–µ–ª—å–Ω–æ–≥–æ –æ–±–Ω–æ–≤–ª–µ–Ω–∏—è
  forceUpdate() {
    this.updateHeaderHeight();
  }
}

// –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∏—Ä—É–µ–º –ø–æ—Å–ª–µ –∑–∞–≥—Ä—É–∑–∫–∏ DOM
document.addEventListener("DOMContentLoaded", () => {
  window.dynamicHeaderHeight = new DynamicHeaderHeight();
});
window.addEventListener("headerHeightUpdated", () => {
  const anchors = document.querySelectorAll("[id]");
  anchors.forEach((el) => {
    el.style.scrollMarginTop = getComputedStyle(
      document.documentElement
    ).getPropertyValue("--header-height");
  });
});

// –¢–∞–∫–∂–µ –∏–Ω–∏—Ü–∏–∞–ª–∏–∑–∏—Ä—É–µ–º —Å—Ä–∞–∑—É, –µ—Å–ª–∏ DOM —É–∂–µ –∑–∞–≥—Ä—É–∂–µ–Ω
if (document.readyState === "loading") {
  // DOM –µ—â–µ –∑–∞–≥—Ä—É–∂–∞–µ—Ç—Å—è, –∂–¥–µ–º DOMContentLoaded
} else {
  // DOM —É–∂–µ –∑–∞–≥—Ä—É–∂–µ–Ω
  window.dynamicHeaderHeight = new DynamicHeaderHeight();
}

// –≠–∫—Å–ø–æ—Ä—Ç–∏—Ä—É–µ–º –∫–ª–∞—Å—Å –¥–ª—è –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏—è –≤ –¥—Ä—É–≥–∏—Ö –º–æ–¥—É–ª—è—Ö
if (typeof module !== "undefined" && module.exports) {
  module.exports = DynamicHeaderHeight;
}

