// –î–∞—ë—Ç —Ç–µ–±–µ –ø–æ–ª–Ω—ã–π –∫–æ–Ω—Ç—Ä–æ–ª—å –Ω–∞–¥ scroll-–ø–æ–≤–µ–¥–µ–Ω–∏–µ–º

function initScrollReset(options = {}) {
  const {
    behavior = "smooth", // 'auto' –∏–ª–∏ 'smooth'
    restoreControl = true, // –û—Ç–∫–ª—é—á–∏—Ç—å history.scrollRestoration –æ—Ç–∫–ª—é—á–∏—Ç—å –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–æ–µ –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ scroll –ø—Ä–∏ –ø–µ—Ä–µ—Ö–æ–¥–µ –Ω–∞–∑–∞–¥
    anchorCleanup = true, // –£–¥–∞–ª–∏—Ç—å #anchor –∏–∑ URL –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ
  } = options;

  document.addEventListener("DOMContentLoaded", () => {
    if (restoreControl && "scrollRestoration" in history) {
      history.scrollRestoration = "manual";
    }
    // –£–¥–∞–ª—è–µ—Ç —è–∫–æ—Ä—å –∏–∑ URL –ï—Å–ª–∏ –≤ URL –µ—Å—Ç—å #section, –æ–Ω —É–¥–∞–ª—è–µ—Ç—Å—è

    // –≠—Ç–æ –ø—Ä–µ–¥–æ—Ç–≤—Ä–∞—â–∞–µ—Ç –∞–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫—É—é –ø—Ä–æ–∫—Ä—É—Ç–∫—É –∫ —è–∫–æ—Ä—é –ø—Ä–∏ –ø–µ—Ä–µ—Ö–æ–¥–µ –º–µ–∂–¥—É —Å—Ç—Ä–∞–Ω–∏—Ü–∞–º–∏
    if (anchorCleanup && location.hash) {
      history.replaceState(null, "", location.pathname + location.search);
    }
    // –ü—Ä–æ–∫—Ä—É—Ç–∫–∞ –∫ –Ω–∞—á–∞–ª—É —Å—Ç—Ä–∞–Ω–∏—Ü—ã

    // behavior: "smooth" –¥–µ–ª–∞–µ—Ç –µ—ë –ø–ª–∞–≤–Ω–æ–π
    window.scrollTo({ top: 0, behavior });
  });
}
// –ê–≤—Ç–æ–º–∞—Ç–∏—á–µ—Å–∫–∏–π –≤—ã–∑–æ–≤
initScrollReset();


