// –®–≤–∏–¥–∫—ñ—Å—Ç—å —Å–ª–∞–π–¥–µ—Ä–∞
// –®–≤–∏–¥–∫—ñ—Å—Ç—å —Å–ª–∞–π–¥–µ—Ä–∞
const heroSliderSpeed = 1500;
document.body.style.setProperty("--hero-slider-speed", heroSliderSpeed + "ms"); // –£—Å—Ç–∞–Ω–æ–≤–∫–∞ CSS-–ø–µ—Ä–µ–º–µ–Ω–Ω–æ–π

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è –¥–æ–±–∞–≤–ª–µ–Ω–∏—è –∞–Ω–∏–º–∞—Ü–∏–æ–Ω–Ω—ã—Ö –∫–ª–∞—Å—Å–æ–≤ –∫ –∞–∫—Ç–∏–≤–Ω–æ–º—É —Å–ª–∞–π–¥—É
function animateActiveSlide(swiper) {
  // –°–Ω–∞—á–∞–ª–∞ —É–¥–∞–ª—è–µ–º –∫–ª–∞—Å—Å—ã –∞–Ω–∏–º–∞—Ü–∏–∏ —Å–æ –≤—Å–µ—Ö —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –≤—Å–µ—Ö —Å–ª–∞–π–¥–æ–≤
  document
    .querySelectorAll(".swiper-slide .reveal-top, .swiper-slide .reveal-bottom")
    .forEach((el) => {
      el.classList.remove("reveal-top", "reveal-bottom");
    });

  // –ù–∞—Ö–æ–¥–∏–º –∞–∫—Ç–∏–≤–Ω—ã–π —Å–ª–∞–π–¥
  const activeSlide = swiper.slides[swiper.activeIndex];

  if (activeSlide) {
    // –ù–∞—Ö–æ–¥–∏–º –∞–Ω–∏–º–∏—Ä—É–µ–º—ã–µ —ç–ª–µ–º–µ–Ω—Ç—ã –≤–Ω—É—Ç—Ä–∏ –∞–∫—Ç–∏–≤–Ω–æ–≥–æ —Å–ª–∞–π–¥–∞
    const title = activeSlide.querySelector(".hero__title");
    const descr = activeSlide.querySelector(".hero__descr");
    const buttons = activeSlide.querySelector(".hero__buttons");

    // –î–æ–±–∞–≤–ª—è–µ–º –∞–Ω–∏–º–∞—Ü–∏–æ–Ω–Ω—ã–µ –∫–ª–∞—Å—Å—ã —Å –Ω–µ–±–æ–ª—å—à–æ–π –∑–∞–¥–µ—Ä–∂–∫–æ–π –¥–ª—è –ø–æ—Å–ª–µ–¥–æ–≤–∞—Ç–µ–ª—å–Ω–æ—Å—Ç–∏
    if (title) setTimeout(() => title.classList.add("reveal-top"), 100);
    if (descr) setTimeout(() => descr.classList.add("reveal-bottom"), 300);
    if (buttons) setTimeout(() => buttons.classList.add("reveal-bottom"), 500);
  }
}

// –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è Swiper
window.onload = function () {
  const heroSlider = new Swiper(".hero-slider", {
    slidesPerView: 1,
    loop: true,
    navigation: {
      nextEl: ".hero-next",
      prevEl: ".hero-prev",
    },
    speed: heroSliderSpeed,
    // autoplay: {
    //   delay: 3500,
    //   disableOnInteraction: false,
    // },
    pagination: {
      el: ".hero__pagination",
      type: "bullets",
      clickable: true,
    },
    on: {
      init: function () {
        // –ö–æ–¥ –¥–ª—è –¥–æ–±–∞–≤–ª–µ–Ω–∏—è —Å–ø–∞–Ω–æ–≤ –≤ –ø–∞–≥–∏–Ω–∞—Ü–∏—é
        const paginationBullets = document.querySelectorAll(
          ".hero__pagination .swiper-pagination-bullet"
        );
        paginationBullets.forEach((el) => {
          el.innerHTML = `<span class="hero__bar"></span>`;
        });

        // –ó–∞–ø—É—Å–∫–∞–µ–º –∞–Ω–∏–º–∞—Ü–∏—é –Ω–∞ –ø–µ—Ä–≤–æ–º —Å–ª–∞–π–¥–µ –ø–æ—Å–ª–µ –∏–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏–∏
        animateActiveSlide(this);
      },
      // –î–æ–±–∞–≤–ª—è–µ–º –æ–±—Ä–∞–±–æ—Ç—á–∏–∫ —Å–æ–±—ã—Ç–∏—è –¥–ª—è –ø–æ–≤—Ç–æ—Ä–∞ –∞–Ω–∏–º–∞—Ü–∏–∏
      slideChangeTransitionEnd: function () {
        animateActiveSlide(this);
      },
    },
  });
};

const portfolioSlider = new Swiper(".section__swiper", {
  slidesPerView: 1,
  spaceBetween: 30,
  loop: true,
  navigation: {
    nextEl: ".portfolio-section__next",
    prevEl: ".portfolio-section__prev",
  },
  breakpoints: {
    576: {
      slidesPerView: 2,
    },
    868: {
      slidesPerView: 3,
    },
  },
});

const testimonialsSlider = new Swiper(".testimonials__swiper", {
  slidesPerView: 1,
  // spaceBetween: 30,
  loop: true,
  navigation: {
    nextEl: ".testimonials__next",
    prevEl: ".testimonials__prev",
  },
});

const workInsideGalery = document.querySelector(".project__slider-big");
// console.log("‚úÖ workInsideGalery –Ω–∞–π–¥–µ–Ω:", workInsideGalery);

if (workInsideGalery) {
  const workSlider = new Swiper(".project__slider-small", {
    spaceBetween: 5,
    slidesPerView: 6,
    freeMode: true,
    watchSlidesProgress: true,
    breakpoints: {
      576: {
        slidesPerView: 6,
        spaceBetween: 10,
      },
      768: {
        slidesPerView: 10,
        spaceBetween: 20,
      },
    },
  });

  const workSlidesNav = new Swiper(workInsideGalery, {
    spaceBetween: 20,
    slidesPerView: 1,
    navigation: {
      nextEl: ".project__btn--next",
      prevEl: ".project__btn--prev",
    },
    thumbs: {
      swiper: workSlider,
    },
    on: {
      slideChange: function () {
        const activeSlide = this.slides[this.activeIndex];
        const img = activeSlide.querySelector(".project__img");

        if (!img) return;

        // –í—ã–±–∏—Ä–∞–µ–º –Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–∏–µ –ø–æ –∏–Ω–¥–µ–∫—Å—É
        const direction =
          this.activeIndex % 2 === 0 ? "img-expand-left" : "img-expand-right";

        // –§—É–Ω–∫—Ü–∏—è –∑–∞–ø—É—Å–∫–∞ –∞–Ω–∏–º–∞—Ü–∏–∏ –±–µ–∑–æ–ø–∞—Å–Ω–æ
        function triggerAnimation(imgEl, className) {
          imgEl.classList.remove(
            "img-expand-left",
            "img-expand-right",
            "active"
          );
          imgEl.style.animation = "none"; // —Å–±—Ä–æ—Å –∞–Ω–∏–º–∞—Ü–∏–∏
          void imgEl.offsetWidth; // —Ñ–æ—Ä—Å-—Ä–µ–Ω–¥–µ—Ä
          imgEl.classList.add(className, "active");
          imgEl.style.animation = ""; // –≤–∫–ª—é—á–∞–µ–º —Å–Ω–æ–≤–∞
        }

        // –ï—Å–ª–∏ –∏–∑–æ–±—Ä–∞–∂–µ–Ω–∏–µ —É–∂–µ –∑–∞–≥—Ä—É–∂–µ–Ω–æ
        if (img.complete && img.naturalWidth !== 0) {
          triggerAnimation(img, direction);
        } else {
          // –ü–æ–¥–æ–∂–¥—ë–º –∑–∞–≥—Ä—É–∑–∫—É, –ø—Ä–µ–∂–¥–µ —á–µ–º –∞–Ω–∏–º–∏—Ä–æ–≤–∞—Ç—å
          img.addEventListener("load", () => triggerAnimation(img, direction), {
            once: true,
          });
        }
      },
    },
  });

  // –ù–∞—á–∞–ª—å–Ω–∞—è –∞–Ω–∏–º–∞—Ü–∏—è –¥–ª—è –ø–µ—Ä–≤–æ–≥–æ —Å–ª–∞–π–¥–∞
  const activeSlide = workInsideGalery.querySelector(".swiper-slide-active");
  const img = activeSlide?.querySelector(".project__img");
  if (img) img.classList.add("img-expand-left");
}

const historySlider = document.querySelector(".history__slider-images");

if (historySlider) {
  const workSlider = new Swiper(historySlider, {
    spaceBetween: 20,
    slidesPerView: 1,
    navigation: {
      nextEl: ".history__next",
      prevEl: ".history__prev",
    },
  });

  workSlider.on("slideChange", function () {
    // console.log(workSlider.realIndex);

    historyBtns.forEach((el) => {
      el.classList.remove("history-nav__btn--active");
    });

    document
      .querySelector(`.history-nav__btn[data-index="${workSlider.realIndex}"]`)
      .classList.add("history-nav__btn--active");
  });

  const historyBtns = document.querySelectorAll(".history-nav__btn");

  historyBtns.forEach((el, idx) => {
    el.setAttribute("data-index", idx);

    el.addEventListener("click", (e) => {
      const index = e.currentTarget.dataset.index;

      historyBtns.forEach((el) => {
        el.classList.remove("history-nav__btn--active");
      });

      e.currentTarget.classList.add("history-nav__btn--active");

      workSlider.slideTo(index);
    });
  });
}

