// === –ì–µ–Ω–µ—Ä–∞—Ü–∏—è —É–Ω–∏–∫–∞–ª—å–Ω–æ–≥–æ –∫–ª—é—á–∞ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö —Ñ–æ—Ä–º—ã ===
const getStorageKey = (form) =>
  "form-storage:" + (form.getAttribute("name") || form.id || "default");

document.addEventListener("DOMContentLoaded", () => {
  // === –ö–ª–∞—Å—Å –∫–∞—Å—Ç–æ–º–Ω–æ–π –≤–∞–ª–∏–¥–∞—Ü–∏–∏ —Ñ–æ—Ä–º—ã ===
  class FormsValidation {
    selectors = {
      form: "[data-js-form]",
      fieldErrors: "[data-js-form-field-errors]",
    };

    // === –°–æ–æ–±—â–µ–Ω–∏—è –æ–± –æ—à–∏–±–∫–∞—Ö –ø–æ —Ç–∏–ø—É ===
    errorMessages = {
      valueMissing: () => "–ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –∑–∞–ø–æ–ª–Ω–∏—Ç–µ —ç—Ç–æ –ø–æ–ª–µ",
      patternMismatch: ({ title }) => title || "–ù–µ–≤–µ—Ä–Ω—ã–π —Ñ–æ—Ä–º–∞—Ç –¥–∞–Ω–Ω—ã—Ö",
      tooShort: ({ minLength }) => `–ú–∏–Ω–∏–º—É–º —Å–∏–º–≤–æ–ª–æ–≤ ‚Äî ${minLength}`,
      tooLong: ({ maxLength }) => `–ú–∞–∫—Å–∏–º—É–º —Å–∏–º–≤–æ–ª–æ–≤ ‚Äî ${maxLength}`,
    };

    constructor() {
      this.bindEvents();
      this.bindAccessibility();
    }

    // === –°–≤—è–∑—å input –∏ –±–ª–æ–∫–∞ –æ—à–∏–±–æ–∫ —á–µ—Ä–µ–∑ aria-errormessage ===
    bindAccessibility() {
      document.querySelectorAll(this.selectors.form).forEach((form) => {
        const formId = form.getAttribute("name") || form.id || "form";
        form.querySelectorAll("[required]").forEach((input) => {
          const name = input.getAttribute("name");
          if (!name) return; // –ü—Ä–æ–ø—É—Å–∫–∞–µ–º –ø–æ–ª—è –±–µ–∑ –∏–º–µ–Ω–∏

          // –ò—â–µ–º –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä –¥–ª—è –æ—à–∏–±–æ–∫ –±–æ–ª–µ–µ –Ω–∞–¥–µ–∂–Ω—ã–º —Å–ø–æ—Å–æ–±–æ–º
          const errorSpan =
            // –°–Ω–∞—á–∞–ª–∞ –∏—â–µ–º –ø–æ ID, –µ—Å–ª–∏ –æ–Ω —É–∂–µ –µ—Å—Ç—å
            form.querySelector(`#${formId}-${name}-error`) ||
            // –ó–∞—Ç–µ–º –∏—â–µ–º –≤ —Ä–æ–¥–∏—Ç–µ–ª—å—Å–∫–æ–º label
            input.closest("label")?.querySelector(this.selectors.fieldErrors) ||
            // –ò–ª–∏ –≤ —Ä–æ–¥–∏—Ç–µ–ª—å—Å–∫–æ–º fieldset (–¥–ª—è —Ä–∞–¥–∏–æ-–≥—Ä—É–ø–ø)
            input
              .closest("fieldset")
              ?.querySelector(this.selectors.fieldErrors);

          if (errorSpan) {
            // –ì–µ–Ω–µ—Ä–∏—Ä—É–µ–º —É–Ω–∏–∫–∞–ª—å–Ω—ã–π ID –¥–ª—è –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞ –æ—à–∏–±–æ–∫, –µ—Å–ª–∏ –µ–≥–æ –µ—â–µ –Ω–µ—Ç
            const uniqueId = errorSpan.id || `${formId}-${name}-error`;
            errorSpan.id = uniqueId;
            // –°–≤—è–∑—ã–≤–∞–µ–º –ø–æ–ª–µ —Å –µ–≥–æ –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–æ–º –æ—à–∏–±–æ–∫
            input.setAttribute("aria-errormessage", uniqueId);
          }
        });
      });
    }

    // === –û—Ç–æ–±—Ä–∞–∂–µ–Ω–∏–µ –æ—à–∏–±–æ–∫ –≤ DOM (–ï–î–ò–ù–ê–Ø –§–£–ù–ö–¶–ò–Ø) ===
    manageErrors(formControlElement, errorMessages) {
      // –ù–∞—Ö–æ–¥–∏–º ID –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞ –æ—à–∏–±–æ–∫ –ø–æ aria-–∞—Ç—Ä–∏–±—É—Ç—É
      const errorId = formControlElement.getAttribute("aria-errormessage");
      if (!errorId) return;

      const fieldErrorsElement = document.getElementById(errorId);

      if (fieldErrorsElement) {
        // –û–±–Ω–æ–≤–ª—è–µ–º —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ –∫–æ–Ω—Ç–µ–π–Ω–µ—Ä–∞, —Å–æ–∑–¥–∞–≤–∞—è HTML –¥–ª—è –æ—à–∏–±–æ–∫
        fieldErrorsElement.innerHTML = errorMessages
          .map((msg) => `<span class="form-error">${msg}</span>`)
          .join("");
      }
    }

    // === –í–∞–ª–∏–¥–∞—Ü–∏—è radio-–≥—Ä—É–ø–ø—ã (–ù–û–í–ê–Ø –§–£–ù–ö–¶–ò–Ø) ===
    validateRadioGroup(radioElement) {
      const errorMessages = [];
      const form = radioElement.closest(this.selectors.form);
      const groupName = radioElement.name;
      const group = form.querySelectorAll(`input[name="${groupName}"]`);
      const isRequired = [...group].some((radio) => radio.required);

      // –ï—Å–ª–∏ –≥—Ä—É–ø–ø–∞ –Ω–µ –æ–±—è–∑–∞—Ç–µ–ª—å–Ω–∞, –≤–∞–ª–∏–¥–∞—Ü–∏—è –Ω–µ –Ω—É–∂–Ω–∞
      if (!isRequired) return true;

      const isChecked = [...group].some((radio) => radio.checked);
      const wrapper = radioElement.closest(".form__fields-inner");

      if (!isChecked) {
        errorMessages.push(
          "–ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –≤—ã–±–µ—Ä–∏—Ç–µ –ø—Ä–µ–¥–ø–æ—á—Ç–∏—Ç–µ–ª—å–Ω—ã–π —Å–ø–æ—Å–æ–± —Å–≤—è–∑–∏"
        );
      }

      if (wrapper) {
        wrapper.classList.toggle("is-invalid", !isChecked);
      }

      // –û–±–Ω–æ–≤–ª—è–µ–º ARIA-–∞—Ç—Ä–∏–±—É—Ç—ã –¥–ª—è –≤—Å–µ–π –≥—Ä—É–ø–ø—ã
      group.forEach((radio) => {
        radio.setAttribute("aria-invalid", String(!isChecked));
      });

      // –û—Ç–æ–±—Ä–∞–∂–∞–µ–º –æ—à–∏–±–∫—É –æ–¥–∏–Ω —Ä–∞–∑ –¥–ª—è –≤—Å–µ–π –≥—Ä—É–ø–ø—ã, –∏—Å–ø–æ–ª—å–∑—É—è –ø–µ—Ä–≤—ã–π —ç–ª–µ–º–µ–Ω—Ç
      this.manageErrors(group[0], errorMessages);

      return isChecked;
    }

    // === –í–∞–ª–∏–¥–∞—Ü–∏—è –æ–¥–Ω–æ–≥–æ –ø–æ–ª—è (–∫—Ä–æ–º–µ radio) ===
    validateField(formControlElement) {
      const errorMessages = [];
      const errors = formControlElement.validity;
      const isSelect = formControlElement.tagName === "SELECT";

      // --- –õ–æ–≥–∏–∫–∞ –¥–ª—è radio-–≥—Ä—É–ø–ø –≤—ã–Ω–µ—Å–µ–Ω–∞ –≤ validateRadioGroup ---

      // === –ö–∞—Å—Ç–æ–º–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ –¥–ª—è SELECT —Å Choices.js ===
      if (
        isSelect &&
        formControlElement.required &&
        !formControlElement.value
      ) {
        errorMessages.push("–ü–æ–∂–∞–ª—É–π—Å—Ç–∞, –≤—ã–±–µ—Ä–∏—Ç–µ –ª–æ–∫–∞—Ü–∏—é");
      }

      // === –°—Ç–∞–Ω–¥–∞—Ä—Ç–Ω—ã–µ HTML5 –æ—à–∏–±–∫–∏ (–∫—Ä–æ–º–µ radio –∏ select)
      if (!isSelect) {
        Object.entries(this.errorMessages).forEach(([type, getMessage]) => {
          if (errors[type]) {
            errorMessages.push(getMessage(formControlElement));
          }
        });
      }

      // === –û–ø—Ä–µ–¥–µ–ª—è–µ–º –≤–∞–ª–∏–¥–Ω–æ—Å—Ç—å –ø–æ–ª—è
      const isValid = errorMessages.length === 0;

      // === –û–±–Ω–æ–≤–ª—è–µ–º aria-–∞—Ç—Ä–∏–±—É—Ç—ã
      formControlElement.setAttribute("aria-invalid", !isValid);

      // === –û–±–Ω–æ–≤–ª—è–µ–º –∫–ª–∞—Å—Å—ã –¥–ª—è –≤–∏–∑—É–∞–ª—å–Ω–æ–π –æ–±—Ä–∞—Ç–Ω–æ–π —Å–≤—è–∑–∏
      formControlElement.classList.toggle("is-valid", isValid);
      formControlElement.classList.toggle("is-invalid", !isValid);

      // === –î–ª—è SELECT —Å Choices.js ‚Äî —Å—Ç–∏–ª–∏–∑—É–µ–º .choices__inner
      if (isSelect) {
        const wrapper = formControlElement
          .closest(".choices")
          ?.querySelector(".choices__inner");
        if (wrapper) {
          wrapper.classList.toggle("is-valid", isValid);
          wrapper.classList.toggle("is-invalid", !isValid);
        }
      }

      // === –û—Ç–æ–±—Ä–∞–∂–∞–µ–º –∏–ª–∏ –æ—á–∏—â–∞–µ–º —Å–æ–æ–±—â–µ–Ω–∏–µ –æ–± –æ—à–∏–±–∫–µ —á–µ—Ä–µ–∑ –µ–¥–∏–Ω—É—é —Ñ—É–Ω–∫—Ü–∏—é
      this.manageErrors(formControlElement, errorMessages);

      return isValid;
    }

    // === –í–∞–ª–∏–¥–∞—Ü–∏—è –ø—Ä–∏ –ø–æ—Ç–µ—Ä–µ —Ñ–æ–∫—É—Å–∞ –ª—é–±–æ–≥–æ required-–ø–æ–ª—è ===
    onBlur(event) {
      const { target } = event;
      const form = target.closest(this.selectors.form);

      if (!form || !target.required) return;

      // --- –í—ã–∑—ã–≤–∞–µ–º —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–∏–π –≤–∞–ª–∏–¥–∞—Ç–æ—Ä ---
      if (target.type === "radio") {
        this.validateRadioGroup(target);
      } else {
        this.validateField(target);
      }
    }

    // === –í–∞–ª–∏–¥–∞—Ü–∏—è –ø—Ä–∏ –∏–∑–º–µ–Ω–µ–Ω–∏–∏ —á–µ–∫–±–æ–∫—Å–æ–≤ –∏ —Ä–∞–¥–∏–æ ===
    onChange(event) {
      const { target } = event;
      const form = target.closest(this.selectors.form);

      if (!form || !target.required) return;

      // --- –í—ã–∑—ã–≤–∞–µ–º —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤—É—é—â–∏–π –≤–∞–ª–∏–¥–∞—Ç–æ—Ä ---
      if (target.type === "radio") {
        this.validateRadioGroup(target);
      } else if (["select-one", "checkbox"].includes(target.type)) {
        this.validateField(target);
      }
    }

    // === –û–±—Ä–∞–±–æ—Ç–∫–∞ –æ—Ç–ø—Ä–∞–≤–∫–∏ —Ñ–æ—Ä–º—ã ===
    onSubmit(event) {
      const form = event.target;
      if (!form.matches(this.selectors.form)) return;

      event.preventDefault(); // –ü—Ä–µ–¥–æ—Ç–≤—Ä–∞—â–∞–µ–º –æ—Ç–ø—Ä–∞–≤–∫—É —Å—Ä–∞–∑—É

      const storageKey = getStorageKey(form);
      const requiredFields = [...form.elements].filter((el) => el.required);
      let isFormValid = true;
      let firstInvalid = null;

      // --- –û–±—Ä–∞–±–∞—Ç—ã–≤–∞–µ–º —Ä–∞–¥–∏–æ-–≥—Ä—É–ø–ø—ã –∫–∞–∫ –µ–¥–∏–Ω–æ–µ —Ü–µ–ª–æ–µ ---
      const validatedRadioGroups = new Set();

      requiredFields.forEach((el) => {
        let isFieldValid;

        if (el.type === "radio") {
          // –í–∞–ª–∏–¥–∏—Ä—É–µ–º –≥—Ä—É–ø–ø—É —Ç–æ–ª—å–∫–æ –æ–¥–∏–Ω —Ä–∞–∑
          if (validatedRadioGroups.has(el.name)) {
            return; // –ì—Ä—É–ø–ø–∞ —É–∂–µ –ø—Ä–æ–≤–µ—Ä–µ–Ω–∞, –ø—Ä–æ–ø—É—Å–∫–∞–µ–º
          }
          isFieldValid = this.validateRadioGroup(el);
          validatedRadioGroups.add(el.name);
        } else {
          // –í–∞–ª–∏–¥–∏—Ä—É–µ–º –≤—Å–µ –æ—Å—Ç–∞–ª—å–Ω—ã–µ –ø–æ–ª—è
          isFieldValid = this.validateField(el);
        }

        if (!isFieldValid) {
          isFormValid = false;
          if (!firstInvalid) {
            firstInvalid = el;
          }
        }
      });

      if (!isFormValid) {
        firstInvalid?.focus();
      } else {
        let savedData = null;
        try {
          savedData = localStorage.getItem(storageKey);
        } catch (error) {
          console.error("–û—à–∏–±–∫–∞ —á—Ç–µ–Ω–∏—è –∏–∑ localStorage:", error);
        }

        const rawData = savedData ? JSON.parse(savedData) : {};

        // === –û—á–∏—Å—Ç–∫–∞ –¥–∞–Ω–Ω—ã—Ö –æ—Ç –ª–∏—à–Ω–∏—Ö –ø—Ä–æ–±–µ–ª–æ–≤ ===
        const cleanedData = {};
        for (let key in rawData) {
          const value = rawData[key];
          if (typeof value === "string") {
            cleanedData[key] = value
              .replace(/^\s+|\s+$/g, "")
              .replace(/\n{2,}/g, "\n")
              .trim();
          } else {
            cleanedData[key] = value;
          }
        }

        console.log("‚úÖ –û—Ç–ø—Ä–∞–≤–∫–∞ –¥–∞–Ω–Ω—ã—Ö:", cleanedData);

        form.reset();
        // –ü–æ—Å–ª–µ —Å–±—Ä–æ—Å–∞ –æ—Ç–º–µ—á–∞–µ–º —á–µ–∫–±–æ–∫—Å –≤—Ä—É—á–Ω—É—é
        const policyCheckbox = form.querySelector(".js-policy-checkbox");
        if (policyCheckbox) policyCheckbox.checked = true;

        try {
          localStorage.removeItem(storageKey);
        } catch (error) {
          console.error("–û—à–∏–±–∫–∞ —É–¥–∞–ª–µ–Ω–∏—è –∏–∑ localStorage:", error);
        }
        createAlertBox(form); // —Ñ—É–Ω–∫—Ü–∏—è –æ—Ç–æ–±—Ä–∞–∂–µ–Ω–∏—è —É—Å–ø–µ—à–Ω–æ–≥–æ —Å–æ–æ–±—â–µ–Ω–∏—è
      }
    }

    // === –ü—Ä–∏–≤—è–∑–∫–∞ —Å–æ–±—ã—Ç–∏–π ===
    bindEvents() {
      document.addEventListener("blur", (e) => this.onBlur(e), true);
      document.addEventListener("change", (e) => this.onChange(e));
      document.addEventListener("submit", (e) => this.onSubmit(e));
    }
  }

  // === –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –≤–∞–ª–∏–¥–∞—Ü–∏–∏ ===
  new FormsValidation();

  // === –°–æ—Ö—Ä–∞–Ω–µ–Ω–∏–µ –¥–∞–Ω–Ω—ã—Ö —Ñ–æ—Ä–º—ã –≤ localStorage –ø—Ä–∏ –≤–≤–æ–¥–µ ===
  document.querySelectorAll("[data-js-form]").forEach((form) => {
    const storageKey = getStorageKey(form);

    const handleSave = ({ target }) => {
      const { name, type, value, checked } = target;
      if (!name) return;

      let currentData = {};
      try {
        currentData = JSON.parse(localStorage.getItem(storageKey)) || {};
      } catch (error) {
        console.error("–û—à–∏–±–∫–∞ —á—Ç–µ–Ω–∏—è –∏–∑ localStorage:", error);
        return; // –ï—Å–ª–∏ –Ω–µ –º–æ–∂–µ–º –ø—Ä–æ—á–∏—Ç–∞—Ç—å, –Ω–µ—Ç —Å–º—ã—Å–ª–∞ –ø—Ä–æ–¥–æ–ª–∂–∞—Ç—å
      }

      // –û–±—Ä–∞–±–∞—Ç—ã–≤–∞–µ–º —á–µ–∫–±–æ–∫—Å—ã –∏ –æ—Å—Ç–∞–ª—å–Ω—ã–µ –ø–æ–ª—è –ø–æ-—Ä–∞–∑–Ω–æ–º—É
      if (type === "checkbox") {
        // –î–ª—è —á–µ–∫–±–æ–∫—Å–æ–≤ –≤—Å–µ–≥–¥–∞ —Å–æ—Ö—Ä–∞–Ω—è–µ–º –∏—Ö —Å–æ—Å—Ç–æ—è–Ω–∏–µ (true/false)
        currentData[name] = checked;
      } else {
        // –î–ª—è —Ç–µ–∫—Å—Ç–æ–≤—ã—Ö –ø–æ–ª–µ–π –æ—á–∏—â–∞–µ–º –∑–Ω–∞—á–µ–Ω–∏–µ
        const cleanedValue = value.replace(/\n{2,}/g, "\n").trim();

        if (cleanedValue) {
          // –ï—Å–ª–∏ –ø–æ—Å–ª–µ –æ—á–∏—Å—Ç–∫–∏ —á—Ç–æ-—Ç–æ –æ—Å—Ç–∞–ª–æ—Å—å, —Å–æ—Ö—Ä–∞–Ω—è–µ–º
          currentData[name] = cleanedValue;
        } else {
          // –ï—Å–ª–∏ –ø–æ–ª–µ —Å—Ç–∞–ª–æ –ø—É—Å—Ç—ã–º, —É–¥–∞–ª—è–µ–º –µ–≥–æ –∏–∑ —Ö—Ä–∞–Ω–∏–ª–∏—â–∞
          delete currentData[name];
        }
      }

      // –ï—Å–ª–∏ –≤ –æ–±—ä–µ–∫—Ç–µ –¥–∞–Ω–Ω—ã—Ö –±–æ–ª—å—à–µ –Ω–µ –æ—Å—Ç–∞–ª–æ—Å—å –∫–ª—é—á–µ–π,
      // —É–¥–∞–ª—è–µ–º –≤—Å—é –∑–∞–ø–∏—Å—å –¥–ª—è —ç—Ç–æ–π —Ñ–æ—Ä–º—ã –∏–∑ localStorage.
      if (Object.keys(currentData).length === 0) {
        try {
          localStorage.removeItem(storageKey);
        } catch (error) {
          console.error("–û—à–∏–±–∫–∞ —É–¥–∞–ª–µ–Ω–∏—è –∏–∑ localStorage:", error);
        }
      } else {
        // –ò–Ω–∞—á–µ —Å–æ—Ö—Ä–∞–Ω—è–µ–º –æ–±–Ω–æ–≤–ª–µ–Ω–Ω—ã–π –æ–±—ä–µ–∫—Ç.
        try {
          localStorage.setItem(storageKey, JSON.stringify(currentData));
        } catch (error) {
          console.error("–û—à–∏–±–∫–∞ –∑–∞–ø–∏—Å–∏ –≤ localStorage:", error);
        }
      }
    };

    form.addEventListener("input", handleSave);
    form.addEventListener("change", handleSave);
  });

  // === –í–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –¥–∞–Ω–Ω—ã—Ö –∏–∑ localStorage –ø—Ä–∏ –∑–∞–≥—Ä—É–∑–∫–µ ===
  document.querySelectorAll("[data-js-form]").forEach((form) => {
    const storageKey = getStorageKey(form);
    let saved = null;
    try {
      saved = localStorage.getItem(storageKey);
    } catch (error) {
      console.error("–û—à–∏–±–∫–∞ —á—Ç–µ–Ω–∏—è –∏–∑ localStorage:", error);
    }
    if (!saved) return;

    const formData = JSON.parse(saved);
    for (let key in formData) {
      const el = form.elements[key];
      if (!el) continue;

      // === –û–±—Ä–∞–±–æ—Ç–∫–∞ —Ä–∞–∑–Ω—ã—Ö —Ç–∏–ø–æ–≤ –ø–æ–ª–µ–π ===
      if (el.length && el[0]?.type === "radio") {
        // –î–ª—è radio-–≥—Ä—É–ø–ø –∏—â–µ–º –Ω—É–∂–Ω—ã–π —ç–ª–µ–º–µ–Ω—Ç –ø–æ –∑–Ω–∞—á–µ–Ω–∏—é
        const radioToSelect = [...el].find(
          (radio) => radio.value === formData[key]
        );
        if (radioToSelect) {
          radioToSelect.checked = true;
          // –í—ã–∑—ã–≤–∞–µ–º —Å–æ–±—ã—Ç–∏–µ, —á—Ç–æ–±—ã –¥—Ä—É–≥–∏–µ —Å–∫—Ä–∏–ø—Ç—ã (–µ—Å–ª–∏ –µ—Å—Ç—å) –æ—Ç—Ä–µ–∞–≥–∏—Ä–æ–≤–∞–ª–∏
          radioToSelect.dispatchEvent(new Event("change", { bubbles: true }));
        }
      } else if (el.type === "checkbox") {
        // –î–ª—è —á–µ–∫–±–æ–∫—Å–æ–≤ –≤–æ—Å—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º —Å–æ—Å—Ç–æ—è–Ω–∏–µ checked
        el.checked = formData[key];
        el.dispatchEvent(new Event("change", { bubbles: true }));
      } else {
        // –î–ª—è –æ—Å—Ç–∞–ª—å–Ω—ã—Ö –ø–æ–ª–µ–π (text, textarea, select)
        el.value = formData[key];
        // –î–ª—è select —Å Choices.js –Ω—É–∂–Ω–æ –≤—ã–∑–≤–∞—Ç—å —Å–æ–±—ã—Ç–∏–µ, —á—Ç–æ–±—ã –æ–±–Ω–æ–≤–∏–ª—Å—è UI
        if (el.tagName === "SELECT") {
          el.dispatchEvent(new Event("change", { bubbles: true }));
        }
      }
    }
  });

  // === –ú–∞—Å–∫–∞ —Ç–µ–ª–µ—Ñ–æ–Ω–∞ –∏ –ø—Ä–æ–≥—Ä–µ—Å—Å-–±–∞—Ä ===
  document.querySelectorAll("[data-js-form]").forEach((form, index) => {
    if (typeof IMask === "undefined") {
      console.warn("IMask –Ω–µ –ø–æ–¥–∫–ª—é—á—ë–Ω, –º–∞—Å–∫–∞ —Ç–µ–ª–µ—Ñ–æ–Ω–∞ –Ω–µ –±—É–¥–µ—Ç —Ä–∞–±–æ—Ç–∞—Ç—å.");
      return;
    }

    const phoneInput = form.querySelector("[data-js-phone]");
    const progressLine = form.querySelector(".progress-line");

    if (phoneInput && typeof IMask !== "undefined") {
      IMask(phoneInput, {
        mask: "+{38} (000) 000-00-00",
      });

      phoneInput.addEventListener("input", function () {
        const length = this.value.length;
        const w = this.offsetWidth;
        if (progressLine) {
          progressLine.style.width = (w / 19) * length + "px";
          progressLine.style.backgroundColor = `rgb(${
            255 - (255 / 19) * length
          },137,0)`;
        }
      });

      phoneInput.addEventListener("blur", () => {
        if (progressLine) progressLine.style.display = "none";
      });

      phoneInput.addEventListener("focus", () => {
        if (progressLine) progressLine.style.display = "block";
      });
    }
  });

  // === –ë–ª–æ–∫–∏—Ä–æ–≤–∫–∞ –∫–Ω–æ–ø–∫–∏ –æ—Ç–ø—Ä–∞–≤–∫–∏, –µ—Å–ª–∏ –ø–æ–ª–∏—Ç–∏–∫–∞ –Ω–µ –ø—Ä–∏–Ω—è—Ç–∞ (–¥–ª—è –∫–∞–∂–¥–æ–π —Ñ–æ—Ä–º—ã) ===
  document.querySelectorAll("[data-js-form]").forEach((form) => {
    // –ò—â–µ–º —á–µ–∫–±–æ–∫—Å –∏ –∫–Ω–æ–ø–∫—É –≤–Ω—É—Ç—Ä–∏ –∫–∞–∂–¥–æ–π –∫–æ–Ω–∫—Ä–µ—Ç–Ω–æ–π —Ñ–æ—Ä–º—ã
    const policyCheckbox = form.querySelector(".js-policy-checkbox");
    const btnSubmit = form.querySelector("[data-js-submit]");

    if (policyCheckbox && btnSubmit) {
      // –£—Å—Ç–∞–Ω–∞–≤–ª–∏–≤–∞–µ–º –Ω–∞—á–∞–ª—å–Ω–æ–µ —Å–æ—Å—Ç–æ—è–Ω–∏–µ –∫–Ω–æ–ø–∫–∏
      btnSubmit.disabled = !policyCheckbox.checked;
      // –î–æ–±–∞–≤–ª—è–µ–º –æ–±—Ä–∞–±–æ—Ç—á–∏–∫ –¥–ª—è –æ—Ç—Å–ª–µ–∂–∏–≤–∞–Ω–∏—è –∏–∑–º–µ–Ω–µ–Ω–∏–π
      policyCheckbox.addEventListener("change", (e) => {
        btnSubmit.disabled = !e.currentTarget.checked;
      });
    }
  });
});

const videoBlock = document.querySelector(".video__block");

if (videoBlock) {
  const video = document.querySelector("video");

  video.addEventListener("canplay", () => {
    // video.controls = true; // –≤–∫–ª—é—á–∞–µ–º –¥–æ play()
    video.muted = false;
  });

  const playBtn = videoBlock.querySelector(".video__button");

  if (video && playBtn) {
    let saveInterval;

    // ‚ñ∂Ô∏è –ó–∞–ø—É—Å–∫ –≤–∏–¥–µ–æ —Å –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ–º –ø—Ä–æ–≥—Ä–µ—Å—Å–∞
    function playVideo(startFromBeginning = false) {
      if (startFromBeginning || video.ended) {
        video.currentTime = 0;
      } else {
        const savedTime = localStorage.getItem("videoplayer-current-time");
        if (savedTime) {
          video.currentTime = parseFloat(savedTime);
        }
      }

      // –ü–æ–ø—ã—Ç–∫–∞ –≤–æ—Å–ø—Ä–æ–∏–∑–≤–µ–¥–µ–Ω–∏—è —Å –æ–±—Ä–∞–±–æ—Ç–∫–æ–π –æ—à–∏–±–æ–∫
      video
        .play()
        .then(() => {
          video.controls = true;
          videoBlock.classList.add("video__block--played");
          playBtn.classList.add("video__button--played");
          playBtn.setAttribute("aria-pressed", "true");
          playBtn.style.display = "none";

          // ‚è±Ô∏è –°–æ—Ö—Ä–∞–Ω—è–µ–º –ø—Ä–æ–≥—Ä–µ—Å—Å –∫–∞–∂–¥—ã–µ 5 —Å–µ–∫—É–Ω–¥
          saveInterval = setInterval(() => {
            localStorage.setItem("videoplayer-current-time", video.currentTime);
          }, 5000);
        })
        .catch((err) => {
          console.warn("‚õîÔ∏è –ù–µ —É–¥–∞–ª–æ—Å—å –∑–∞–ø—É—Å—Ç–∏—Ç—å –≤–∏–¥–µ–æ:", err);
        });
    }

    // ‚è∏Ô∏è –ü–∞—É–∑–∞ –∏ –≤–æ–∑–≤—Ä–∞—Ç –∫–Ω–æ–ø–∫–∏
    function pauseVideo() {
      video.pause();
      video.controls = false;
      videoBlock.classList.remove("video__block--played");
      playBtn.classList.remove("video__button--played");
      playBtn.setAttribute("aria-pressed", "false");
      playBtn.style.display = "flex";

      clearInterval(saveInterval);
      localStorage.setItem("videoplayer-current-time", video.currentTime);
    }

    // üîÑ –°–±—Ä–æ—Å –ø—Ä–æ–≥—Ä–µ—Å—Å–∞ –ø—Ä–∏ –∑–∞–≤–µ—Ä—à–µ–Ω–∏–∏
    function resetVideoProgress() {
      localStorage.removeItem("videoplayer-current-time");
    }

    // ‚ñ∂Ô∏è –ö–ª–∏–∫ –ø–æ –∫–∞—Å—Ç–æ–º–Ω–æ–π –∫–Ω–æ–ø–∫–µ –∑–∞–ø—É—Å–∫–∞–µ—Ç –≤–∏–¥–µ–æ
    playBtn.addEventListener("click", () => {
      try {
        video.muted = false; // –æ–±—è–∑–∞—Ç–µ–ª—å–Ω–æ –≤—ã–∫–ª—é—á–∏—Ç—å mute
        video.currentTime = 0; // –∏–ª–∏ –≤–æ—Å—Å—Ç–∞–Ω–æ–≤–∏—Ç—å savedTime
        video.play(); // —Å—Ç—Ä–æ–≥–æ –≤–Ω—É—Ç—Ä–∏ click
        video.controls = true;
        videoBlock.classList.add("video__block--played");
        playBtn.classList.add("video__button--played");
        playBtn.setAttribute("aria-pressed", "true");
        playBtn.style.display = "none";

        saveInterval = setInterval(() => {
          localStorage.setItem("videoplayer-current-time", video.currentTime);
        }, 5000);
      } catch (err) {
        console.warn("Firefox –±–ª–æ–∫–∏—Ä—É–µ—Ç –≤–æ—Å–ø—Ä–æ–∏–∑–≤–µ–¥–µ–Ω–∏–µ:", err);
      }
    });

    // ‚è∏Ô∏è –ö–ª–∏–∫ –ø–æ –≤–∏–¥–µ–æ ‚Äî –ø–∞—É–∑–∞
    video.addEventListener("click", () => {
      if (!video.paused) {
        pauseVideo();
      }
    });

    // ‚è∏Ô∏è –û–±—Ä–∞–±–æ—Ç–∫–∞ —Å–æ–±—ã—Ç–∏—è –ø–∞—É–∑—ã
    video.addEventListener("pause", pauseVideo);

    // üõë –ó–∞–≤–µ—Ä—à–µ–Ω–∏–µ –≤–∏–¥–µ–æ ‚Äî —Å–±—Ä–æ—Å —Å–æ—Å—Ç–æ—è–Ω–∏—è
    video.addEventListener("ended", () => {
      resetVideoProgress();
      playBtn.style.display = "flex";
      playBtn.classList.remove("video__button--played");
      video.controls = false;
    });

    // üíæ –°–æ—Ö—Ä–∞–Ω—è–µ–º –ø—Ä–æ–≥—Ä–µ—Å—Å –ø—Ä–∏ —É—Ö–æ–¥–µ —Å–æ —Å—Ç—Ä–∞–Ω–∏—Ü—ã
    window.addEventListener("visibilitychange", () => {
      if (document.visibilityState === "hidden" && !video.ended) {
        localStorage.setItem("videoplayer-current-time", video.currentTime);
      }
    });
  }
}

